import React from 'react';
import { BrowserRouter, Switch, Router} from 'react-router-dom';

import Main from './pages/main';

const Routes = () => (
    <BrowserRouter>
        <Switch>
            <Router path="/" componet={Main} />
        </Switch>
    </BrowserRouter>
);

export default Routes;
